Here is the grammar for a version (EBNF notation): VERSION = VERSION_CORE, [ RELEASE_IDENTIFIER ], [ BUILD_NUMBER ];
VERSION_CORE = MAJOR_VERSION, `.`, MINOR_VERSION, `.`, PATCH_VERSION;
RELEASE_IDENTIFIER = `-`, RELEASE_TYPE, [RELEASE_NUMBER];
BUILD_NUMBER = `+`, NUMBER;
MAJOR_VERSION = NUMBER;
MINOR_VERSION = NUMBER;
PATCH_VERSION = NUMBER;
RELEASE_TYPE = `unstable` | `beta`;
RELEASE_NUMBER = `.`, NUMBER;
NUMBER = `0` | DIGIT_WITHOUT_ZERO, { DIGIT }
DIGIT_WITHOUT_ZERO = `1` | `2` | `3` | `4` | `5` | `6` | `7` | `8` | `9` ;
DIGIT = `0` | DIGIT_WITHOUT_ZERO ;
